package com.ada.model.api.request;import java.util.Date;public class BalanceHistoryRequest {    private String username;    private Integer transType;    private String msisdn;    private String level;    private Date formDate;    private Date toDate;    private int page;    private int numToPage;    public BalanceHistoryRequest() {    }    public String getUsername() {        return username;    }    public void setUsername(String username) {        this.username = username;    }    public Integer getTransType() {        return transType;    }    public void setTransType(Integer transType) {        this.transType = transType;    }    public String getLevel() {        return level;    }    public void setLevel(String level) {        this.level = level;    }    public Date getFormDate() {        return formDate;    }    public void setFormDate(Date formDate) {        this.formDate = formDate;    }    public Date getToDate() {        return toDate;    }    public void setToDate(Date toDate) {        this.toDate = toDate;    }    public int getPage() {        return page;    }    public void setPage(int page) {        this.page = page;    }    public int getNumToPage() {        return numToPage;    }    public void setNumToPage(int numToPage) {        this.numToPage = numToPage;    }    public String getMsisdn() {        return msisdn;    }    public void setMsisdn(String msisdn) {        this.msisdn = msisdn;    }}